(function(window, document, $, undefined) {
  "use strict";
  $(function() {
    $("body").on("click", "[data-qt-block]", function(e) {
      e.stopPropagation();
      var $this = $(this),
      target = $(this).data("qt-block");

      switch (target) {
        /*-----------------------------------------------------------------------
        Element blocking
        -----------------------------------------------------------------------*/
        /**
        * Action: Open
        **/
        case ".block-el":
        var $blockTarget = $(this)
        .parents(".card")
        .find(target);
        $blockTarget.append('<div class="qt-block-ui"></div>');
        var $block = $blockTarget.find(".qt-block-ui");
        setTimeout(function() {
          $block.fadeOut("3000", function() {
            $block.remove();
          });
        }, 1700);

        break;
        /*-----------------------------------------------------------------------
        Form blocking
        -----------------------------------------------------------------------*/
        case "#block-form":
        $(target).submit(function(event) {
          event.preventDefault();
          $(target)
          .find("input")
          .attr("disabled", "disabled");
          $this.addClass("btn-block-ui").attr("disabled", "disabled");
          setTimeout(function() {
            $(target)
            .find("input")
            .attr("disabled", false)
            .val("");
            $this.removeClass("btn-block-ui").attr("disabled", false);
          }, 3000);
          return true;
        });

        break;
        /*-----------------------------------------------------------------------
        Full Page Blocking
        -----------------------------------------------------------------------*/
        case "body":
        $(target).append('<div class="qt-block-ui"></div>');
        var $block = $(".qt-block-ui");
        setTimeout(function() {
          $block.fadeOut("3000", function() {
            $block.remove();
          });
        }, 1700);

        break;
      }
    });
  });
})(window, document, window.jQuery);

